import React from 'react';
import './App.css';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      monsters: []
    }
  }

  componentDidMount() {
    fetch("https://jsonplaceholder.typicode")
  }

  render() {
    return (
      <div>
        {this.state.monsters.map(monster => <h1 key={monster.id}>{monster.name}</h1>)}
      </div>
    )
  }

}

export default App;
